import React, { useState, useRef } from 'react';
import { Camera, Barcode, Cat, Dog, Info } from 'lucide-react';
import { Alert, AlertTitle, AlertDescription } from './components/ui/Alert';


const App = () => {
  const [animal, setAnimal] = useState('');
  const [barcode, setBarcode] = useState('');
  const [result, setResult] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const fileInputRef = useRef();

  const checkBarcode = async () => {
    setIsLoading(true);
    setError('');
    try {
      const response = await fetch('http://localhost:5000/api/check-barcode', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ barcode, animal }),
      });
      const data = await response.json();
      if (response.ok) {
        setResult(data.result);
      } else {
        setError(data.error);
      }
    } catch (err) {
      setError('Erreur de connexion au serveur');
    }
    setIsLoading(false);
  };

  const handleImageUpload = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    setIsLoading(true);
    setError('');

    const formData = new FormData();
    formData.append('image', file);
    formData.append('animal', animal);

    try {
      const response = await fetch('http://localhost:5000/api/scan-image', {
        method: 'POST',
        body: formData,
      });
      const data = await response.json();
      if (response.ok) {
        setBarcode(data.barcode);
        setResult(data.result);
      } else {
        setError(data.error);
      }
    } catch (err) {
      setError('Erreur de connexion au serveur');
    }
    setIsLoading(false);
  };

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <div className="max-w-md mx-auto bg-white rounded-xl shadow-md overflow-hidden">
        <div className="p-6">
          <h1 className="text-2xl font-bold mb-6 text-center">
            Vérificateur d'aliments pour animaux
          </h1>

          <div className="space-y-4">
            <div className="flex gap-2 justify-center">
              <button
                onClick={() => setAnimal('chat')}
                className={`flex items-center gap-2 px-4 py-2 rounded-lg ${
                  animal === 'chat' ? 'bg-blue-500 text-white' : 'bg-gray-200'
                }`}
              >
                <Cat size={20} /> Chat
              </button>
              <button
                onClick={() => setAnimal('chien')}
                className={`flex items-center gap-2 px-4 py-2 rounded-lg ${
                  animal === 'chien' ? 'bg-blue-500 text-white' : 'bg-gray-200'
                }`}
              >
                <Dog size={20} /> Chien
              </button>
              <button
                onClick={() => setAnimal('lapin')}
                className={`flex items-center gap-2 px-4 py-2 rounded-lg ${
                  animal === 'lapin' ? 'bg-blue-500 text-white' : 'bg-gray-200'
                }`}
              >
                🐰 Lapin
              </button>
            </div>

            <div className="space-y-2">
              <div className="flex gap-2">
                <input
                  type="text"
                  value={barcode}
                  onChange={(e) => setBarcode(e.target.value)}
                  placeholder="Code-barres du produit"
                  className="flex-1 p-2 border rounded"
                />
                <button
                  onClick={checkBarcode}
                  disabled={!animal || !barcode || isLoading}
                  className="bg-blue-500 text-white p-2 rounded disabled:bg-gray-300"
                >
                  <Barcode size={24} />
                </button>
              </div>

              <div className="text-center">
                <span className="text-gray-500">ou</span>
              </div>

              <button
                onClick={() => fileInputRef.current?.click()}
                disabled={!animal || isLoading}
                className="w-full flex items-center justify-center gap-2 bg-green-500 text-white p-3 rounded disabled:bg-gray-300"
              >
                <Camera size={24} />
                Scanner un code-barres
              </button>
              <input
                type="file"
                accept="image/*"
                capture="environment"
                ref={fileInputRef}
                onChange={handleImageUpload}
                className="hidden"
              />
            </div>

            {isLoading && (
              <div className="text-center text-gray-600">
                Chargement...
              </div>
            )}

            {error && (
              <Alert variant="destructive">
                <AlertTitle>Erreur</AlertTitle>
                <AlertDescription>{error}</AlertDescription>
              </Alert>
            )}

            {result && (
              <Alert variant={result.includes('✅') ? 'default' : 'destructive'}>
                <Info className="h-4 w-4" />
                <AlertTitle>Résultat</AlertTitle>
                <AlertDescription className="whitespace-pre-line">
                  {result}
                </AlertDescription>
              </Alert>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
